import {Subgroup} from "../model/Subgroup";

const s1=new Subgroup(1,935,1);
const s2=new Subgroup(2,931,2);
const s3=new Subgroup(3,932,1);
const s4=new Subgroup(4,935,2);
const s5=new Subgroup(5,915,2);
const s6=new Subgroup(6,925,1);
const s7=new Subgroup(7,927,2);
const s8=new Subgroup(8,935,1);
const s9=new Subgroup(9,945,2);
const s10=new Subgroup(10,935,1);

export const subgroups=[s1,s2,s3,s4,s5,s6,s7,s8,s9,s10]
